set all fields in subdocument to false, then set the second one to true in a single query<p>Suppose I have the following the document structure.</p>
<pre><code>[
  {
    &quot;_id&quot;: 1,
    &quot;depots&quot;: [
      {
        &quot;_id&quot;: 1,
        &quot;isFavourite&quot;: true
      },
      {
        &quot;_id&quot;: 2,
        &quot;isFavourite&quot;: false
      },
      {
        &quot;_id&quot;: 3,
        &quot;isFavourite&quot;: true
      },
      {
        &quot;_id&quot;: 4,
        &quot;isFavourite&quot;: false
      }
    ]
  }
]
</code></pre>
<p>I want to write a <strong>single update query</strong> which filters for the document with <code>_id: 1</code> and first sets every <code>isFavourite</code> value to <code>false</code> and then sets the second <code>isFavourite</code> value (or any specified index) to <code>true</code>.</p>
<p>The resulting document should look like this.</p>
<pre><code>[
  {
    &quot;_id&quot;: 1,
    &quot;depots&quot;: [
      {
        &quot;_id&quot;: 1,
        &quot;isFavourite&quot;: false
      },
      {
        &quot;_id&quot;: 2,
        &quot;isFavourite&quot;: true
      },
      {
        &quot;_id&quot;: 3,
        &quot;isFavourite&quot;: false
      },
      {
        &quot;_id&quot;: 4,
        &quot;isFavourite&quot;: false
      }
    ]
  }
]
</code></pre>
<p>What I tried:</p>
<pre><code>db.collection.update({
  _id: 1
},
[
  {
    &quot;$set&quot;: {
      &quot;depots.isFavourite&quot;: false
    }
  },
  {
    &quot;$set&quot;: {
      &quot;depots.2.isFavourite&quot;: true
    }
  }
])
</code></pre>
<p>Yet strangely this does not work. See the linked playground for the result of this query.</p>
<p><a href="https://mongoplayground.net/p/Ffp8B8BVuXA" rel="nofollow noreferrer">Mongo Playground</a></p>

