Prevent users from writing other user's data in node.js<p>I have three different types of users in my node-js schema:
1 -&gt; user, 2 -&gt; merchant 3 -&gt; provider</p>
<p>Now i am giving only merchant users to post the data about parking.</p>
<p>I have this query in node.js to update the parking data:</p>
<pre><code>exports.updateParking = async (req, res) =&gt; {
  try {
    const { parkingId, parkingName, price, address, name, phoneNumber, about } =
      req.body;
    const check_exist = await Auth.findById(req.data.id);
    if (!check_exist) return res.status(404).json({ error: &quot;User not found&quot; });

    const updateData = await Parking.updateOne(
      { _id: parkingId },
      {
        $set: {
          parkingName,
          price,
          //...other details
        },
      }
    );
    return res.status(200).json({
      success: true,
      msg: &quot;Parking has updated successfully&quot;,
    });
  } catch (error) {
    return error.message;
  }
};
</code></pre>
<p>I am using JWT to authenticate the users.
Here is the middleware: <code>routing.patch(&quot;/parking/update/:id&quot;,middleware.authenticateToken,merchant.updateParking);</code></p>
<p>How to alter the above query such that only the original poster(merchant user) may edit the details and that anybody else cannot.</p>

