array default object mongoose schema<p>I have a mongoose schema and I want to provide a default value but anytime I provide that, I run into an error. This is the schema object value I want to provide a default value for and how I currently pass it.</p>
<pre><code>statusData: {
        type: [

            {
                status: { ...trimmedString, required: false, default: 'new' },
                createdAt: {
                    type: SchemaTypes.Date,
                    required: false,
                    default: Date.now
                },
                updatedAt: {
                    type: SchemaTypes.Date,
                    required: false,
                    default: null
                },
            },
        ],
        default: [ {
            status: 'new',
            createdAt: Date.now,
            updatedAt: null
        }],
      }
</code></pre>
<p>But I get this error every time.</p>
<blockquote>
<p>validation failed: statusData.0.createdAt: Cast to date failed for
value &quot;[Function: now]&quot; at path &quot;createdAt&quot;&quot;</p>
</blockquote>
<p>any help on how I can provide a default value here</p>

