<p>Issue is that when I run all tests from the root, <code>mongodb-memory-server</code> starts downloading MongoDB and tests using it of course time out. Then the whole test process terminates by timeout before the MongoDB is fully downloaded, so next time it will start download it again.</p>
<p>A couple of points:</p>
<ol>
<li>I understand the MongoDB is downloaded by <code>mongodb-memory-server</code> at dep install time. That is, in my case, when I run <code>lerna bootstrap</code>. And I am not using <code>mongodb-memory-server-core</code>, but directly <code>mongodb-memory-server</code>. Given that I see the <code>mongodb-memory-server</code> cache in the root <code>node_modules</code>, that should be working as expected.</li>
<li>Given point 1, I suspect that when tests get executed, they search for that cache in the package <code>node_modules</code> and not in the root. Why so? According to <a href="https://github.com/lerna/lerna/issues/1079#issuecomment-337660289" rel="nofollow noreferrer">this comment</a> I understand it should be searching it in the root <code>node_modules</code> instead.</li>
</ol>
<p>Here my global test setup, simplified</p>
<pre><code>const mongod = new MongoMemoryServer()

beforeAll(async done =&gt; {
